} pub fn main() { let mut test1 = unsafe { Pin::new_unchecked(&mut Test::new("test1")) }; Test::init(test1.as_mut()); let mut test2 = unsafe { Pin::new_unchecked(&mut Test::new("test2")) }; Test::init(test2.as_mut()); println!("a: {}, b: {}", Test::a(test1.as_ref()), Test::b(test1.as_ref())); std::mem::swap(test1.get_mut(), test2.get_mut()); println!("a: {}, b: {}", Test::a(test2.as_ref()), Test::b(test2.as_ref()));
} æˆ‘ä»¬å°è¯•æŠŠ&mut Testé’‰åœ¨æ ˆä¸Šï¼Œç„¶åå°è¯•å»è°ƒç”¨get_mut()ä½œä¸ºå‚æ•°ä¼ ç»™std::mem::swap()ï¼Œå‘ç°ç¼–è¯‘ä¸é€šè¿‡ã€‚Rust ç¼–è¯‘å™¨ä»ç¼–è¯‘é˜¶æ®µå°±é˜»æ­¢æˆ‘ä»¬å»çŠ¯é”™äº†ã€‚ | std::mem::swap(test1.get_mut(), test2.get_mut()); | ^^^^^^^ within `Test`, the trait `Unpin` is not implemented for `PhantomPinned` |

